import React from "react";
import Card from "../UI/Card";
import classes from './AddNewUser.module.css'

const NewUser = props => {
    const addUser = event => {
        event.preventDefault();
    };

    return (
        <Card className={classes.input}>
        <form onSubmit={addUser}>
            <label htmlFor="uername">Username</label>
            <input id="username" type='text' placeholder="What is your username?"></input>
            <label htmlFor="age">Age</label>
            <input id="age" type='number' placeholder="How old are you?"></input>
            <button type="submit">Add new user</button>
        </form>
        </Card>
    );
};

export default NewUser;
